import Error from "./pages/Error";
import './App.css';

function App() {
  return (
    <>
    <Route path="/" component={Home}/>
    <Route path="/rooms" component={Rooms}/>
    <Route path="/single-room" component={SingleRoom}/>
    <Route path="/" component={Home}/>


    </>
  );
}

export default App;
